import React from 'react';
import './article.css';

const Article = ({imgUrl, date, title}) => {
  return (
    <div className='gpt3__blog-cotnainer_article'>
      <div className='gpt3__blog-cotnainer_article-image'>
        <img src= {imgUrl}  alt='blog image'/>

      </div>
      Article
    </div>
  )
}

export default Article
